import Tabla from "./Tabla";
import custom_Form from "./Custom_Form";

function Usuarios() {

  function enviar(){
    try {
      
    } catch (error) {
      
    }
  }
  function error() {
    setTimeout(() => {
      document.cookie = 'error=true';
      window.location = 'http://localhost:3000/Login';
    }, 2500);

  }

  if (localStorage.getItem('privilegio') === '1') {
    return [
      <div>
        <Tabla filas_por_pagina={4} tabla={'usuarios'}></Tabla>
        <custom_Form elementos={[]} id={'enviar'} titulo={'Enviar datos'} submit={enviar()}  ></custom_Form>
      </div>
    ];
  } else {

    error();
  }
}
export default Usuarios;
